css:
.text-info code {
  color: #5293d8;
  background: rgba(0, 152, 255, 0.2);
}
.text-info a,
.text-info a code {
  text-decoration: underline;
  color: #2d79ca;
}
.text-info a:hover,
.text-info a code:hover {
  color: #296db5;
}
.text-success code {
  color: #45a815;
  background: rgba(23, 202, 101, 0.2);
}
.text-success a,
.text-success a code {
  text-decoration: underline;
  color: #327b0f;
}
.text-success a:hover,
.text-success a code:hover {
  color: #29640d;
}
.text-warning code {
  color: #cd8e00;
  background: rgba(255, 72, 0, 0.2);
}
.text-warning a,
.text-warning a code {
  text-decoration: underline;
  color: #9a6b00;
}
.text-warning a:hover,
.text-warning a code:hover {
  color: #815900;
}
.text-error code {
  color: #cc0000;
  background: rgba(204, 0, 0, 0.2);
}
.text-error a,
.text-error a code {
  text-decoration: underline;
  color: #990000;
}
.text-error a:hover,
.text-error a code:hover {
  color: #800000;
}
